<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8" />
    <link rel="stylesheet" href="css-screen2/globals.css" />

  <body>

          <img class="left-actionable" src="img/left-actionable.svg" />
          <img class="menu" src="img/menu.svg" />
        </div>
        <div class="native-status-bar">
          <div class="text-wrapper">9:41</div>

        <div class="overlap-group">

            <div class="frame-2">
